import './index.css'
import {connect} from 'react-redux'
import {orderName} from '../../actions'

export  function Filtro (props){
    function OrderName (){
        props.orderName();
    }
    return (
        <div className="filtro">

             <div className="orden">
                <h4>ordenar</h4>
                <button id='peso'>peso</button>
                <button id='nombre' onClick={OrderName}>nombre</button>
            </div>
            <div className="filtra">
                <h4>filtrar</h4>
                <div>
                    <h5>Temperamento</h5>
                    <nav>
                        <ul id="menutemp">
                        </ul>
                    </nav>
                </div>
                <div>
                    <h5>Raza</h5>
                    <nav>
                        <ul id="menuraza">
                        </ul>
                    </nav>
                </div>
            </div>     
        </div>
    )
}

const mapDispatchToProps = (dispatch) => {
    return {
        orderName: () => dispatch(orderName())
    }
}

export default connect (mapDispatchToProps)(Filtro)

